function PopUpShow(){$("#pop-up-form").fadeIn()}function PopUpHide(){$("#pop-up-form").fadeOut()}function FaqHide(){$(".faq-hidden-text").hide()}function FaqOpen(){$(this).siblings(".faq-hidden-text").toggle()}function SubmitForm(){let o=$(this);return $.get(o.attr("action"),o.serialize()),!1}$(document).ready((function(){PopUpHide(),$(".carousel_slick").slick({autoplay:!0,arrows:!1,dots:!0,slidesToShow:3,adaptiveHeight:!0}),FaqHide()})),$("#pop-up").click(PopUpShow),$("#pop-up-close").click(PopUpHide),$(".faq-toggle").click(FaqOpen),$("form").submit(SubmitForm);